import React, { useState } from 'react';
import './navbar.css';
import logo from '../../assets/logo.png';

function Navbar() {
    return (
        <div className="navbar">
            <div className="about">
            <NavButton text="Обо мне" href="#about" />
            </div>
            <div className="training">
                {<p><a href='#wgpt3'>Тренировки</a></p>}
            </div>
            <div className="center-logo">
            <img src={logo} alt="Logo" />
            </div>
            <div className="price">
                {<p><a href='#possibility'>Цены</a></p>}
            </div>
            <div className="contacts">
                {<p><a href='#features'>Обратная связь</a></p>}
            </div>
        </div>
    );
}

export default Navbar;

function NavButton({ text, href }) {
    return (
        <button onClick={() => scrollToComponent(href)}>
            {text}
        </button>
    );
}

function scrollToComponent(href) {
    const element = document.getElementById(href.substring(1));
    if (element) {
        element.scrollIntoView({ behavior: 'smooth' });
    }
}
